import Vue from 'vue';
import VueRouter from 'vue-router';
import LoginPanel from '../../components/Login/LoginPanel.vue';

Vue.use(VueRouter);

const routes = [
  {
    path: '/LoginPanel',
    component: LoginPanel,
  }
];

const router = new VueRouter({
  mode: 'history',
  routes,
});

export default router;
